//Importing Components from react-router
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';



//Importing other pages
import Pageclient from './components/otherpages/pageclients';

//Importando imagens
import logoback from './img/logoback.png';


function App() {
  return (
    <Router>
      <div>


        <Routes>
        <Route path="/" element={<Home/>} />
          <Route path="/pageclients" element={<Pageclient/>} />
        </Routes>
      
        </div>
    </Router>
  );
}

export default App;
